import React from 'react';
import ReactDOM from 'react-dom';

import appState from './appState.js'

import BeatsContainer from './beats/beats.js';
import SoundsContainer from './sounds/sounds.js';
import TitleContainer from './title/title.js';

import './index.css';

class AppContainer extends React.Component {
    constructor(props){
        super(props)
        this.state = { ...this.props.appState.state }
        this.state.cards = this.state.noteValues[this.state.noteValue]
    }
    render() {
        return React.createElement(
            'div',
            { className: "djim-beats-container" },
            <TitleContainer key="title_container"/>,
            <BeatsContainer key="beats_container" appState={appState}/>,
            <SoundsContainer key="sounds_container" appState={appState}/>
        );
    }
}

ReactDOM.render(
    <AppContainer/>,
    document.getElementById('root')
);
